import React, { Component } from 'react';
import {
  Navbar,
  Nav, } from 'react-bootstrap';
  import { Spring } from  'react-spring/renderprops';
  import Slider from "react-slick";
import sliderImg from './demo.png';
// Add CDN to HTML For Slider
//<link rel="stylesheet" type="text/css" charset="UTF-8" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick.min.css" />
/* <link rel="stylesheet" type="text/css" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick-theme.min.css" /> */
class App extends Component {

  render() {
    //js
    var settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };

  // Styles
  const logoHead = {
    margin:'',
    background:'#5e5684',
    padding:'15px 10px 20px 20px'
  }
  const logoWord = {
    fontSize:'40px',
    marginLeft:'50px',
    color:'white'
  }

  const body = {
    background:'#5e5684'
  }

const imgDem = {
  width:'auto',
  height:'500px'
}


    return (
<div style={body}>


<Spring
from={{ opacity: 0, marginTop:-500}}
to={{opacity: 1, marginTop:0 }}
config={{ delay: 100, duration:1000 }}

>

{ props => (
  <div style={props}>
{/* Insert below */}
<div className="container">
<div className="row">
<div className="col-lg-4">
<div style={logoHead}>
    <h3 style={logoWord}>Logo Here</h3>
</div>
</div>
</div>
</div>
<Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
  <Navbar.Brand href="#home">Our Logo</Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="#features">Option 1</Nav.Link>
      <Nav.Link href="#pricing">Option 2</Nav.Link>
      <Nav.Link href="#features">Option 3</Nav.Link>
      <Nav.Link href="#pricing">Option 4</Nav.Link>
    </Nav>

    <Nav>
      <Nav.Link href="#deets">Info</Nav.Link>
      <Nav.Link eventKey={2} href="#memes">
        login
      </Nav.Link>
    </Nav>
  </Navbar.Collapse>
</Navbar>




  </div>
) }

</Spring>


<br/>


<Spring
from={{ opacity: 0}}
to={{opacity: 1}}
config={{ delay: 2100, duration:2100 }}

>

{ props => (
  <div style={props}>
{/* Insert below */}
<div className="container">
<div className="row">
<div className="col-lg-12">
<Slider {...settings}>
        <div>

          <img src={sliderImg} style={imgDem} />
        </div>
        <div>

          <img src={sliderImg} style={imgDem} />
        </div>
        <div>

          <img src={sliderImg} style={imgDem}/>
        </div>
        <div>

          <img src={sliderImg} style={imgDem} />
        </div>
        <div>

          <img src={sliderImg} style={imgDem} />
        </div>
        <div>

          <img src={sliderImg} style={imgDem} />
        </div>
      </Slider>

</div>
</div>
</div>





  </div>
) }

</Spring>

<br/>
<br/>

      </div>
    )
  }
}


export default App
